评论内容:
500问题的解决：
PageResult.java里的以下三个注解，感觉都没有起作用
@Data
//@NoArgsConstructor
//@AllArgsConstructor
注释掉后面两个，又手动添加了无参构造、getter和setter方法后，才解决了500问题。
应该还是lombok的版本问题，
上次碰到这个问题，实在是解决不了，然后就重建了整个Project，又从76集看了一遍，仍然有收获！[喜极而泣]

