评论内容:
linux头像上传失败的，问题出现在切面类里面，把这个OperateLogAspect类中的
String methodParams = objectMapper.writeValueAsString(joinPoint.getArgs());
这段代码改成
// 处理方法参数，过滤MultipartFile类型
List<Object> safeArgs = new ArrayList<>();
for (Object arg : joinPoint.getArgs()) {
    if (arg instanceof org.springframework.web.multipart.MultipartFile) {
        org.springframework.web.multipart.MultipartFile file = (org.springframework.web.multipart.MultipartFile) arg;
        // 只保留文件元数据，不包含输入流
        Map<String, Object> fileInfo = new HashMap<>();
        fileInfo.put("fileName", file.getOriginalFilename());
        fileInfo.put("fileSize", file.getSize());
        fileInfo.put("contentType", file.getContentType());
        fileInfo.put("fileType", "MultipartFile");
        safeArgs.add(fileInfo);
    } else {
        safeArgs.add(arg);
    }
}
String methodParams = objectMapper.writeValueAsString(safeArgs);
这个就行了

