评论内容:
弄了好久终于显示出来了，根据评论区大佬，在创建项目的时候不要自己勾选lombok（我也不用，因为用了这个注解根本运行不了不懂），然后自己在User里面写setget还有Constructor。
public User() {

    }

    public User(Integer id, String username, String password, String name, Integer age, LocalDateTime updateTime) {

        this.id = id;

        this.username = username;

        this.password = password;

        this.name = name;

        this.age = age;

        this.updateTime = updateTime;

    }
之后在生命周期里面点了一下clean后，运行成功了（之前没点运行不了404）

